\n<modification>\n    <name>Scroll to top</name>\n  <version>1.0</version>\n  <code>ScrollToTop</code>\n  <author>iExtendLabs , Saqib ashraf</author>\n\n<file path=\"catalog/controller/common/footer.php\">\n  <operation>\n   <search><![CDATA[\n      $data[\'powered\'] = sprintf($this->language->get(\'text_powered\'), $this->config->get(\'config_name\'), date(\'Y\', time()));\n   ]]></search>\n   <add position=\"after\"><![CDATA[\n    $this->load->model(\'tool/image\');\n    $data[\'module_scrollUp_status\']=$this->config->get(\'module_scrollUp_status\');\n    $data[\'arrow\']=$this->config->get(\'module_scrollUp_optradio\');\n   \n      \n   ]]></add>\n </operation>\n</file>\n\n  <file path=\"catalog/view/theme/*/template/common/footer.twig\">\n    <operation>\n      <search><![CDATA[\n      </footer>\n      ]]></search>\n      <add position=\"after\"><![CDATA[\n{% if module_scrollUp_status %}\n<p id=\"back-top\">\n    <a href=\"#top\"><span></span></a> \n  </p>\n\n<style>\n\n        /*\nBack to top button \n*/\n#back-top {\n  position: fixed;\n  bottom: 30px;\n  z-index: 99999999999;\n}\n#back-top a {\n  width: 108px;\n  display: block;\n  text-align: center;\n  font: 11px/100% Arial, Helvetica, sans-serif;\n  text-transform: uppercase;\n  text-decoration: none;\n  color: #000;\n  /* background color transition */\n  -webkit-transition: 1s;\n  -moz-transition: 1s;\n  transition: 1s;\n}\n#back-top a:hover {\n  color: #9C1B95;\n}\n/* arrow icon (span tag) */\n#back-top span {\n  height: 60px;\n  width: 60px;\n  display: block;\n  margin-bottom: 7px;\n  background: url(admin/view/image/{{arrow}}) no-repeat center center;\n  background-size: cover; \n  /* rounded corners */\n  -webkit-border-radius: 15px;\n  -moz-border-radius: 15px;\n  border-radius: 15px;\n  /* background color transition */\n  -webkit-transition: 1s;\n  -moz-transition: 1s;\n  transition: 1s;\n}\n#back-top a:hover span {\n  background-color: #9C1B95;\n}\n</style>\n\n  <script>\n$(document).ready(function(){\n\n  // hide #back-top first\n  $(\"#back-top a\").hide();\n  \n  // fade in #back-top\n  $(function () {\n    $(window).scroll(function () {\n      if ($(this).scrollTop() > 100) {\n        $(\'#back-top a\').fadeIn();\n      } else {\n        $(\'#back-top a\').fadeOut();\n      }\n    });\n\n    // scroll body to 0px on click\n    $(\'#back-top a\').click(function () {\n      $(\'body,html\').animate({\n        scrollTop: 0\n      }, 800);\n      return false;\n    });\n  });\n\n});\n</script>\n{% endif %}\n]]></add>\n    </operation>\n  </file>\n  \n</modification>","1","2018-02-20 15:53:55");
