\n    <name><![CDATA[Out of Stock Notification]]></name>\n    <code><![CDATA[Out_of_Stock_Notification]]></code>\n    <version><![CDATA[3.0.x.x]]></version>\n    <author><![CDATA[IRSSOFT]]></author>\n    <link><![CDATA[http://www.irssoft.com]]></link>\n    <file path=\"system/library/cart/cart.php\">\n       <operation>\n   		<search><![CDATA[\'name\'            => $product_query->row[\'name\'], ]]></search>\n	        <add position=\"after\"><![CDATA[ \'qnty\'            => $product_query->row[\'quantity\'], ]]></add>\n       </operation>\n  </file>\n  <file path=\"catalog/controller/checkout/cart.php\">\n       <operation>\n             <search><![CDATA[$this->load->model(\'tool/upload\'); ]]></search>\n             <add position=\"after\"><![CDATA[$data[\'status\']=$this->config->get(\'module_outofstocknotification_status\');]]></add>\n       </operation>\n       <operation>\n             <search><![CDATA[ \'name\'      => $product[\'name\'],]]></search>\n             <add position=\"after\"><![CDATA[\'qnty\'      => $product[\'qnty\'], ]]></add>\n       </operation>\n       <operation>\n              <search><![CDATA[$this->load->model(\'tool/upload\');]]></search>\n              <add position=\"after\"><![CDATA[ $this->load->language(\'checkout/outofstock\');\n					      $data[\'error_message\'] = $this->language->get(\'error_message\'); ]]></add>\n       </operation>\n</file>\n<file path=\"catalog/view/theme/*/template/checkout/cart.twig\">\n      <operation>\n              <search><![CDATA[<small>{{ product.reward }}</small> {% endif %}]]></search>\n              <add position=\"after\"><![CDATA[ <br/>\n						{% if status %}\n					     	   {% if product.qnty != 0 %}\n								{% if product.quantity <= product.qnty %}\n								{% else %}\n								   <span class=\"text-danger\">{{ error_message }} {{ product.qnty }}</span>\n				\n				    		 		{% endif %}	\n						   {% endif %}\n						{% endif %} ]]></add>\n    </operation>\n</file>\n</modification>\n","1","2018-04-05 17:33:11");
\n		<name>Animation Add Cart</name>\n		<code>seogroupaddtop</code>\n        <version>1.0</version>\n        <author>SeoGroup | Dev2Studio</author>\n		<link>http://seogroup.pro/</link>\n		<file path=\"catalog/view/theme/*/template/common/footer.twig\">\n				<operation>\n                        <search><![CDATA[</html>]]></search>\n                        <add position=\"before\"><![CDATA[\n                        <script>\n                        	$(\".product-layout .button-group button:nth-child(1)\").click(function(){var t=$(this).parent(\"div\").parent(\"div\").parent(\"div\");$(\".product-thumb\").css(\"background\",\"white\"),$(t).clone().css({position:\"absolute\",\"z-index\":\"11100\",top:$(this).offset().top-300,left:$(this).offset().left-100}).appendTo(\"body\").addClass(\"clones\").animate({opacity:1,left:$(\"#cart\").offset().left,top:$(\"#cart\").offset().top},1e3,function(){$(\".clones\").detach()})});\n                        </script>					  \n					 \n                        ]]></add>\n                </operation>\n          </file>\n</modification>","1","2018-04-14 14:30:44");
\n<modification>\n  <name>Recently Viewed Products</name>\n  <version>1.0.0</version>\n  <code>recently_viewed_products</code>\n  <author>Meldin Xavier</author>\n  <link>http://www.mxtechweb.com</link>\n\n  <file path=\"catalog/controller/product/product.php\" error=\"log\">\n    <operation info=\"Record View\">\n      <search error=\"log\"><![CDATA[$this->load->language(\'product/product\');]]></search>\n      <add position=\"after\"><![CDATA[if(isset($this->request->get[\'product_id\'])){\n				$viewed_product = array();\n				$viewed_product[]=$this->request->get[\'product_id\'];\n\n				$this->session->data[\'viewed_product_id\'][]=$viewed_product;\n				foreach ($this->session->data[\'viewed_product_id\'] as $key => $value) {\n				$viewed_product[]=$value[0];\n				}\n				setcookie(\'recently_viewed_product\', json_encode($viewed_product), time()+31104000);\n		}]]></add>\n    </operation>\n    </file>\n    <file path=\"catalog/model/catalog/product.php\" error=\"log\">\n    <operation info=\"Model function\">\n      <search error=\"log\"><![CDATA[public function getTotalProductSpecials() {]]></search>\n      <add position=\"before\"><![CDATA[public function getRecentlyViewedProducts($data=array(),$limit) {\n			if(!empty($data)){\n				foreach ($data as $product_id) {\n					if(count($data)<=$limit){\n					$product_data[] = $this->getProduct($product_id);\n					}\n				}\n\n			return $product_data;\n		}\n	}]]></add>\n    </operation>\n  </file>\n</modification>","1","2018-04-14 14:38:01");
\n<modification>\n    <name>DigitCart - Review available only for buyer</name>\n    <code>digitcart_review_available_only_for_buyer</code>\n    <version>1.0</version>\n    <link>http://digitcart.ir</link>\n    <author>digitcart.ir</author>\n	\n	\n	\n\n    <file path=\"catalog/model/account/order.php\">\n        <operation>\n            <search><![CDATA[public function getOrders($start = 0, $limit = 20) {]]></search>\n            <add position=\"before\"><![CDATA[\n				/* DIGITCART - BUYER REVIEW, OPERATION 1 START */\n				public function getAllCompletedOrders() {\n				\n					$order_statuses = $this->config->get(\'config_complete_status\');\n\n					foreach ($order_statuses as $order_status_id) {\n						$implode[] = \"os.order_status_id = \'\" . (int)$order_status_id . \"\'\";\n					}\n\n					$query = $this->db->query(\"SELECT o.order_id FROM `\" . DB_PREFIX . \"order` o LEFT JOIN \" . DB_PREFIX . \"order_status os ON (o.order_status_id = os.order_status_id) WHERE o.customer_id = \'\" . (int)$this->customer->getId() . \"\' AND o.order_status_id > \'0\' AND o.store_id = \'\" . (int)$this->config->get(\'config_store_id\') . \"\' AND os.language_id = \'\" . (int)$this->config->get(\'config_language_id\') . \"\' AND (\" . implode(\" OR \", $implode) . \")\");\n\n					return $query->rows;\n				}\n				/* DIGITCART - BUYER REVIEW, OPERATION 1 END */\n			]]></add>\n        </operation>\n    </file>\n\n    <file path=\"catalog/controller/product/product.php\">\n        <operation>\n            <search><![CDATA[$data[\'tags\'] = array();]]></search>\n            <add position=\"after\"><![CDATA[\n				/* DIGITCART - BUYER REVIEW, OPERATION 1 START */\n				$data[\'is_verified_buyer\'] = $this->isVerifiedBuyer($product_id);\n				$data[\'module_digitcart_buyer_review_messages\'] = $this->config->get(\'module_digitcart_buyer_review_messages\');\n				$data[\'customer_language_id\'] = $this->config->get(\'config_language_id\');\n				/* DIGITCART - BUYER REVIEW, OPERATION 1 END */\n			]]></add>\n        </operation>\n        <operation>\n            <search><![CDATA[public function write() {]]></search>\n            <add position=\"replace\"><![CDATA[\n				/* DIGITCART - BUYER REVIEW, OPERATION 2 START */\n				protected function isVerifiedBuyer($product_id){\n					if($this->config->get(\'module_digitcart_buyer_review_status\')){\n						if($this->customer->isLogged()){\n						\n							$this->load->model(\'account/order\');\n							$customer_orders = $this->model_account_order->getAllCompletedOrders();\n							$customer_buyed_products = array();\n							\n							foreach($customer_orders as $customer_order){\n								$customer_order_products = $this->model_account_order->getOrderProducts($customer_order[\'order_id\']);\n								foreach($customer_order_products as $customer_order_product){\n									$customer_buyed_products[] = $customer_order_product[\'product_id\'];\n								}\n							}\n\n							$customer_buyed_products = array_unique($customer_buyed_products);\n							\n							if(in_array($product_id, $customer_buyed_products)){\n								return true;\n							} else {\n								return false;\n							}\n						}\n					} else {\n						return true;\n					}\n				}\n				\n				public function write() {\n				if(!$this->isVerifiedBuyer($this->request->get[\'product_id\'])){\n					return;\n				}\n				/* DIGITCART - BUYER REVIEW, OPERATION 2 END */\n			]]></add>\n        </operation>\n    </file>\n\n    <file path=\"catalog/view/theme/*/template/product/product.twig\">\n        <operation>\n            <search><![CDATA[<div id=\"review\"></div>]]></search>\n            <add position=\"after\"><![CDATA[\n				<!-- DIGITCART - BUYER REVIEW, OPERATION 1 START -->\n				{% if(is_verified_buyer) %}\n					{% if(module_digitcart_buyer_review_messages[\'verify\'][customer_language_id]) %}\n						<p class=\"alert alert-info\">{{ module_digitcart_buyer_review_messages[\'verify\'][customer_language_id] }}</p>\n					{% endif %}\n				<!-- DIGITCART - BUYER REVIEW, OPERATION 1 END -->\n			]]></add>\n        </operation>\n        <operation>\n            <search index=\"0\"><![CDATA[</form>]]></search>\n            <add position=\"before\"><![CDATA[\n				<!-- DIGITCART - BUYER REVIEW, OPERATION 2 START -->\n				{% else %}\n					{% if(module_digitcart_buyer_review_messages[\'not-verify\'][customer_language_id]) %}\n						<p class=\"alert alert-warning\">{{ module_digitcart_buyer_review_messages[\'not-verify\'][customer_language_id] }}</p>\n					{% endif %}\n				{% endif %}\n				<!-- DIGITCART - BUYER REVIEW, OPERATION 2 END -->\n			]]></add>\n        </operation>\n    </file>\n\n</modification>","1","2018-04-14 14:41:25");
