filter_price\']);\n                    $min = $filter[0];\n                    $max = $filter[1];\n                    if ($max > 0) {\n\n                        if ($product[\'special\']) {\n                            $price = $product[\'special\'];\n                        } else {\n                            $price = $product[\'price\'];\n                        }\n                        $price = $this->tax->calculate($price, $product[\'tax_class_id\'], $this->config->get(\'config_tax\'));\n\n\n                        if ($price < $min || $price > $max) {\n                            continue;\n                        }\n                    }\n                }\n                $total_products++;\n\n            }\n            return $total_products;\n        }else{\n            return $query->row[\'total\'];\n        }\n\n		]]></add>\n        </operation>\n        <operation error=\"log\">\n            <search><![CDATA[\n                $sql .= \" LEFT JOIN \" . DB_PREFIX . \"product_description pd ON (p.product_id = pd.product_id) LEFT JOIN \" . DB_PREFIX . \"product_to_store p2s ON (p.product_id = p2s.product_id) WHERE pd.language_id = \'\" . (int)$this->config->get(\'config_language_id\') . \"\' AND p.status = \'1\' AND p.date_available <= NOW() AND p2s.store_id = \'\" . (int)$this->config->get(\'config_store_id\') . \"\'\";\n			]]>\n            </search>\n            <add position=\"replace\"><![CDATA[\n		        $sql .= \" LEFT JOIN \" . DB_PREFIX . \"product_description pd ON (p.product_id = pd.product_id) LEFT JOIN \" . DB_PREFIX . \"product_to_store p2s ON (p.product_id = p2s.product_id) LEFT JOIN \" . DB_PREFIX . \"product_special ps ON p.product_id = ps.product_id LEFT JOIN \" . DB_PREFIX . \"product_discount pds ON p.product_id = p2s.product_id WHERE pd.language_id = \'\" . (int)$this->config->get(\'config_language_id\') . \"\' AND p.status = \'1\' AND p.date_available <= NOW() AND p2s.store_id = \'\" . (int)$this->config->get(\'config_store_id\') . \"\'\";\n		    ]]></add>\n        </operation>\n\n        <operation error=\"log\">\n            <search><![CDATA[\n                public function updateViewed($product_id)\n            ]]>\n            </search>\n            <add position=\"before\"><![CDATA[\n                 public function getMinMaxProduct($data = array())\n    {\n        $min_price = $this->db->query(\"SELECT MIN(ps.price) as min_special,MIN(p.price) as min_price FROM \" . DB_PREFIX . \"product p LEFT JOIN \" . DB_PREFIX . \"product_to_category p2c ON (p2c.product_id = p.product_id) LEFT JOIN \" . DB_PREFIX . \"product_special ps ON (ps.product_id = p.product_id) WHERE p2c.category_id = \'\" . (int)$data[\'filter_category_id\'] . \"\'\");\n        $max_price = $this->db->query(\"SELECT MAX(p.price) as max,p.tax_class_id, (SELECT price FROM \" . DB_PREFIX . \"product_special ps WHERE ps.product_id = p.product_id AND ps.customer_group_id = \'\" . (int)$this->config->get(\'config_customer_group_id\') . \"\' AND ((ps.date_start = \'0000-00-00\' OR ps.date_start < NOW()) AND (ps.date_end = \'0000-00-00\' OR ps.date_end > NOW())) ORDER BY ps.priority ASC, ps.price ASC LIMIT 1) AS special FROM \" . DB_PREFIX . \"product p LEFT JOIN \" . DB_PREFIX . \"product_to_category p2c ON (p2c.product_id = p.product_id) LEFT JOIN \" . DB_PREFIX . \"product_special ps ON (ps.product_id = p.product_id) WHERE p.price = (SELECT MAX(price) FROM \" . DB_PREFIX . \"product  p LEFT JOIN \" . DB_PREFIX . \"product_to_category p2c ON (p2c.product_id = p.product_id) WHERE p2c.category_id = \'\" . (int)$data[\'filter_category_id\'] . \"\' ) AND p2c.category_id = \'\" . (int)$data[\'filter_category_id\'] . \"\'\");\n\n        if (!empty($max_price->row[\'special\'])) {\n            $price = $max_price->row[\'special\'];\n        } else {\n            $price = $max_price->row[\'max\'];\n        }\n        $max = $this->tax->calculate($price, $max_price->row[\'tax_class_id\'], $this->config->get(\'config_tax\'));\n        if (isset($min_price->row[\'min_special\'])) {\n            $min = $min_price->row[\'min_special\'];\n        } else {\n            $min = $min_price->row[\'min_price\'];\n        }\n        if ($max != null){\n        $max = round($max);\n        $max = $max+(10-(substr($max,-1)));\n\n    }\n        $min_max = array(\n            \'min\' => $min,\n            \'max\' => $max,\n        );\n\n        return $min_max;\n    }\n            ]]></add>\n        </operation>\n\n    </file>\n\n</modification>","1","2019-01-17 17:05:20");
\n<modification>\n  <name>OCMOD Editor for OpenCart 3.0</name>\n  <code>ocmod-editor</code>\n  <version>3.2.0</version>\n  <author>OpenCart Brasil</author>\n  <link>http://www.opencartbrasil.com.br</link>\n  <file path=\"admin/controller/startup/permission.php\">\n    <operation>\n      <search><![CDATA[$extension = array(]]></search>\n      <add position=\"after\"><![CDATA[\'extension/modification\',]]></add>\n    </operation>\n  </file>\n  <file path=\"admin/controller/marketplace/modification.php\">\n    <operation>\n      <search><![CDATA[public function index() {]]></search>\n      <add position=\"after\"><![CDATA[\n        $this->load->model(\'user/user_group\');\n        $this->model_user_user_group->addPermission($this->user->getGroupId(), \'access\', \'extension/modification/editor\');\n        $this->model_user_user_group->addPermission($this->user->getGroupId(), \'modify\', \'extension/modification/editor\');\n        $this->model_user_user_group->addPermission($this->user->getGroupId(), \'access\', \'extension/modification/error_log\');\n        $this->model_user_user_group->addPermission($this->user->getGroupId(), \'modify\', \'extension/modification/error_log\');\n        $this->model_user_user_group->addPermission($this->user->getGroupId(), \'access\', \'extension/modification/files\');\n        $this->model_user_user_group->addPermission($this->user->getGroupId(), \'modify\', \'extension/modification/files\');\n        $this->model_user_user_group->addPermission($this->user->getGroupId(), \'access\', \'extension/modification/diff\');\n        $this->model_user_user_group->addPermission($this->user->getGroupId(), \'modify\', \'extension/modification/diff\');\n      ]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[$data[\'refresh\'] = $this->url->link(\'marketplace/modification/refresh\', \'user_token=\' . $this->session->data[\'user_token\'] . $url, true);]]></search>\n      <add position=\"before\"><![CDATA[\n        $data[\'log_error\'] = $this->url->link(\'extension/modification/error_log\', \'user_token=\' . $this->session->data[\'user_token\'] . $url, true);\n        $data[\'files\'] = $this->url->link(\'extension/modification/files\', \'user_token=\' . $this->session->data[\'user_token\'] . $url, true);\n        $data[\'new\'] = $this->url->link(\'extension/modification/editor\', \'user_token=\' . $this->session->data[\'user_token\'] . $url, true);\n      ]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[$data[\'modifications\'][] = array(]]></search>\n      <add position=\"after\"><![CDATA[\n        \'edit\' => $this->url->link(\'extension/modification/editor\', \'user_token=\' . $this->session->data[\'user_token\'] . \'&modification_id=\' . $result[\'modification_id\'], true),\n        \'download\' => $this->url->link(\'extension/modification/editor/download\', \'user_token=\' . $this->session->data[\'user_token\'] . \'&modification_id=\' . $result[\'modification_id\'], true),\n      ]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[public function index() {]]></search>\n      <add position=\"after\"><![CDATA[$this->load->language(\'extension/modification/editor\');]]></add>\n    </operation>\n    <operation>\n      <search index=\"1\"><![CDATA[$this->response->redirect($this->url->link(\'marketplace/modification\', \'user_token=\' . $this->session->data[\'user_token\'] . $url, true));]]></search>\n      <add position=\"replace\"><![CDATA[\n        if (isset($this->request->get[\'modification_editor\'])) {\n            echo $this->session->data[\'success\'];\n            exit;\n        } else {\n            $this->response->redirect($this->url->link(\'marketplace/modification\', \'user_token=\' . $this->session->data[\'user_token\'] . $url, true));\n        }\n      ]]></add>\n    </operation>\n  </file>\n  <file path=\"admin/view/template/marketplace/modification.twig\">\n    <operation>\n      <search><![CDATA[<div class=\"pull-right\">]]></search>\n      <add position=\"after\"><![CDATA[<a href=\"{{ log_error }}\" data-toggle=\"tooltip\" title=\"{{ button_log_error }}\" class=\"btn btn-default\"><i class=\"fa fa-exclamation-triangle\"></i></a> <a href=\"{{ files }}\" data-toggle=\"tooltip\" title=\"{{ button_files }}\" class=\"btn btn-default\"><i class=\"fa fa-list-alt\"></i></a> <a href=\"{{ new }}\" data-toggle=\"tooltip\" title=\"{{ button_new }}\" class=\"btn btn-primary\"><i class=\"fa fa-plus\"></i></a>]]></add>\n    </operation>\n    <operation>\n      <search><![CDATA[{% if not modification.enabled %}]]></search>\n      <add position=\"before\"><![CDATA[\n        <a href=\"{{ modification.edit }}\" data-toggle=\"tooltip\" title=\"{{ button_edit }}\" class=\"btn btn-primary\"><i class=\"fa fa-pencil\"></i></a>\n        <a href=\"{{ modification.download }}\" data-toggle=\"tooltip\" title=\"{{ button_download }}\" class=\"btn btn-success\"><i class=\"fa fa-cloud-download\"></i></a>\n      ]]></add>\n    </operation>\n  </file>\n</modification>","1","2019-01-19 16:27:45");
\n    <name>Accu Auto Backup</name>\n    <version>1.0.1</version>\n    <link>http://www.dhanashree.com</link>\n    <author>Dhanshree Inc.</author>\n    <code>accu_auto_backup</code>\n    <file path=\"catalog/model/setting/setting.php\">  \n        <operation>\n            <search><![CDATA[public function getSetting($code, $store_id = 0) {]]></search>\n            <add position=\"before\"><![CDATA[			\n              /* Accu Schedule Backup - Begin */\n               public function editSetting($code, $data, $storeId = 0)\n    {\n        $this->db->query(\"DELETE FROM `\" . DB_PREFIX . \"setting` WHERE store_id = \'\" . (int) $storeId . \"\' AND `code` = \'\" . $this->db->escape($code) . \"\'\");\n\n        foreach ($data as $key => $value) {\n            if (substr($key, 0, strlen($code)) == $code) {\n                if (!is_array($value)) {\n                    $this->db->query(\"INSERT INTO \" . DB_PREFIX . \"setting SET store_id = \'\" . (int) $storeId . \"\', `code` = \'\" . $this->db->escape($code) . \"\', `key` = \'\" . $this->db->escape($key) . \"\', `value` = \'\" . $this->db->escape($value) . \"\'\");\n                } else {\n                    $this->db->query(\"INSERT INTO \" . DB_PREFIX . \"setting SET store_id = \'\" . (int) $storeId . \"\', `code` = \'\" . $this->db->escape($code) . \"\', `key` = \'\" . $this->db->escape($key) . \"\', `value` = \'\" . $this->db->escape(json_encode($value, true)) . \"\', serialized = \'1\'\");\n                }\n            }\n        }\n    }\n\n              /* Accu Schedule Backup - End */\n			]]></add>\n        </operation>\n    </file>\n  	\n</modification>","1","2019-01-20 07:58:55");
\n		<name>TO TOP</name>\n		<code>dotboxtotop</code>\n        <version>1.1</version>\n        <author>? Dotbox Creative</author>\n		<link>http://dotboxcreative.com/</link>\n		<file path=\"catalog/view/theme/*/template/common/footer.twig\">\n				<operation>\n                        <search><![CDATA[</html>]]></search>\n                        <add position=\"before\"><![CDATA[\n						 <style type=\"text/css\">\n							#ToTopHover {\n							cursor: pointer;\n							background: url(data:image/png;base64,) no-repeat left -51px;width: 51px;height: 51px;display: block;overflow: hidden;float: left;opacity: 0;-moz-opacity: 0;filter: alpha(opacity=0);}\n							#ToTop {display: none;text-decoration: none;position: fixed;bottom: 20px;right: 20px;overflow: hidden;width: 51px;height: 51px;border: none;text-indent: -999px;background: url(data:image/png;base64,) no-repeat left top;}\n						</style>\n						<script type=\"text/javascript\">\n						/* UItoTop jQuery */\n						jQuery(document).ready(function(){$().UItoTop({easingType:\'easeOutQuint\'});});\n						(function($){\n							$.fn.UItoTop = function(options) {\n								var defaults = {\n									text: \'To Top\',\n									min: 200,\n									inDelay:600,\n									outDelay:400,\n									containerID: \'ToTop\',\n									containerHoverID: \'ToTopHover\',\n									scrollSpeed: 1600,\n									easingType: \'linear\'\n								};\n								var settings = $.extend(defaults, options);\n								var containerIDhash = \'#\' + settings.containerID;\n								var containerHoverIDHash = \'#\'+settings.containerHoverID;\n								$(\'body\').append(\'<span id=\"\'+settings.containerID+\'\">\'+settings.text+\'</span>\');\n								$(containerIDhash).hide().click(function(event){\n									$(\'html, body\').animate({scrollTop: 0}, settings.scrollSpeed);\n									event.preventDefault();\n								})\n								.prepend(\'<span id=\"\'+settings.containerHoverID+\'\"></span>\')\n								.hover(function() {\n										$(containerHoverIDHash, this).stop().animate({\n											\'opacity\': 1\n										}, 600, \'linear\');\n									}, function() { \n										$(containerHoverIDHash, this).stop().animate({\n											\'opacity\': 0\n										}, 700, \'linear\');\n									});			\n								$(window).scroll(function() {\n									var sd = $(window).scrollTop();\n									if(typeof document.body.style.maxHeight === \"undefined\") {\n										$(containerIDhash).css({\n											\'position\': \'absolute\',\n											\'top\': $(window).scrollTop() + $(window).height() - 50\n										});\n									}\n									if ( sd > settings.min ) \n										$(containerIDhash).fadeIn(settings.inDelay);\n									else \n										$(containerIDhash).fadeOut(settings.Outdelay);\n								});\n						};\n						})(jQuery);\n						</script>\n                        ]]></add>\n                </operation>\n          </file>\n</modification>","1","2018-12-29 08:46:49");



